                style={{
                    backgroundColor: `${color}`, 
                    color: `${fontColor}`,
                    borderRadius: '5px',
                    padding: `5px ${btnSize}`
                }}
            >
                {text}
            </button>
        </React.Fragment>
    )
}

export default Button
